import React from 'react'

function FormButton(props) {
  return (
    <button type={props.type} disabled={props.disabled} hidden={props.hidden} onClick={props.onClick}
      className="disabled:text-gray-300 bg-gray-100 py-4 px-6 rounded-md"
    >{props.buttonText}</button>
  )
}

export default FormButton
